"description": "\u6bcf\u5929\u85c9\u6b64\u4ee5\u7f8e\u597d\u72c0\u614b\u958b\u555f\u65b0\u7684\u4e00\u5929\uff0c\u6c72\u53d6\u610f\u8b58\u7684\u7121\u9650\u529b\u91cf\uff0c\u986f\u5316\u6211\u5011\u8877\u5fc3\u7684\u610f\u5716\u3002\n\n\u7576\u4eba\u5011\u900f\u904e\u9748\u9b42\u540c\u6b65\u7df4\u7fd2\uff0c\u555f\u52d5\u9019\u90e8\u5206\u7684\u610f\u8b58\uff0c\u771f\u5fc3\u610f\u5716\u6703\u5f37\u5927\u5230\u8db3\u4ee5\u6253\u7834\u601d\u7dd2\u5c4f\u969c\uff0c\u9032\u5165\u7269\u8cea\u4e16\u754c\u3002\n\n\u63a5\u4e0b\u4f86\uff0c\u4f60\u6703\u611f\u5230\u81ea\u5df1\u5f77\u5f7f\u548c\u5b87\u5b99\u5efa\u7acb\u4e86\u89aa\u5bc6\u7684\u65b0\u95dc\u4fc2\uff0c\u6574\u500b\u4e16\u754c\u4f3c\u4e4e\u52d5\u54e1\u4e86\u8d77\u4f86\uff0c\u8b93\u4f60\u9ad4\u9a57\u5230\u5b87\u5b99\u7684\u540c\u6b65\u6027\u8207\u5171\u6642\u6027\u3002\n\n\u8b93\u4e00\u5207\u90fd\u64f4\u5c55\u5728\u7121\u9650\u610f\u8b58\u8207\u5408\u4e00\u610f\u8b58\u4e4b\u4e2d\uff0c\u5728\u9019\u500b\u5834\u57df\uff0c\u610f\u5ff5\u5373\u7269\u8cea\uff0c\u7948\u9858\u5373\u5be6\u76f8\u3002\n\n\u9858\u6211\u627e\u5230\u6211\u5c0b\u6c42\u7684\u7b54\u6848\u2728\n\u9858\u6211\u767c\u6398\u6211\u9700\u8981\u7684\u89e3\u65b9\u2728\n\u9858\u6211\u7372\u5f97\u7f8e\u597d\u7684\u751f\u547d\u2728\n\nNamaste\ud83e\udeb7\n\n\uff0f\uff0f\uff0f\n\n\u7b2c\u4e00\u500b\u7406\u89e3\uff1a\n\u4eba\u751f\u7684\u9650\u5236\u4f86\u81ea\u65bc\u4f60\u5c0d\u5b87\u5b99\u4efb\u4f55\u4e8b\u7269\u7684\u89c0\u9ede\uff0c\u4f60\u7684\u89c0\u9ede\u5275\u9020\u4e86\u4f60\u7684\u751f\u547d\u5be6\u76f8\n\n\u2705\u9ad8\u610f\u8b58\u72c0\u614b\n- \u5409\u7965\u6027/\u7f8e\u597d\u7965\u548c\n- \u5efa\u8a2d\u6027/ win-win\n- \u5275\u9020\u6027\n\n\u26d4\ufe0f\u4f4e\u610f\u8b58\u72c0\u614b\n- \u7834\u58de\u6027\n- \u91cd\u8907\u6027\n- \u5f37\u5236\u6027\n\n\uff0f\n\n\u7b2c\u4e8c\u500b\u7406\u89e3\uff1a\n\u2728\u8ca1\u5bcc(Artha)\uff1a\u5404\u7a2e\u5f62\u5f0f\u7684\u8ca1\u5bcc\uff0c\u4ee5\u53ca\u8ca1\u5bcc\u80fd\u5e36\u4f86\u7684\u8212\u9069\u548c\u4eab\u53d7\n\u2728\u611b (Kama)\uff1a\u95dc\u4fc2\u4e2d\u7684\u611b\uff0c\u5305\u62ec\u771f\u646f\u60c5\u611f\u3001\u89aa\u5bc6\u3001\u5c0a\u91cd\u548c\u6148\u60b2\n\u2728\u751f\u547d\u76ee\u7684(Dharma)\uff1a\u70ba\u5bb6\u4eba\u3001\u7d44\u7e54\u3001\u4e16\u754c\u5275\u9020\u6539\u8b8a\u7684\u71b1\u60c5\n\u2728\u9748\u6027\u89ba\u9192(Mukti)\uff1a\u8b93\u4f60\u5f9e\u82e6\u96e3\u548c\u5206\u96e2\u7684\u5e7b\u76f8\u5f97\u5230\u89e3\u812b\n\n\uff0f\n\n\u7b2c\u4e09\u500b\u7406\u89e3\uff1a\n- \u70ba\u4e86\u5168\u7136\u751f\u6d3b\uff0c\u5fc5\u9808\u7d42\u7d50\u5c0d\u6b7b\u4ea1\u7684\u6050\u61fc\u3002\n- \u70ba\u4e86\u5168\u5fc3\u53bb\u611b\uff0c\u5fc5\u9808\u6d88\u878d\u5931\u671b\u3002\n- \u70ba\u4e86\u9ad4\u9a57\u7f8e\u597d\u72c0\u614b\uff0c\u5fc5\u9808\u5c0d\u53d7\u82e6\u901a\u900f\u6d1e\u5bdf\uff0c\u5f9e\u800c\u5f97\u5230\u81ea\u7531\u3002\n\n\uff0f\n\n\u7b2c\u56db\u500b\u7406\u89e3\uff1a\n- \u6709\u610f\u8b58\u7684\u8ca1\u5bcc\u5275\u9020\u8005\uff0c\u6703\u89ba\u5bdf\u81ea\u5df1\u662f\u5728\u4ec0\u9ebc\u72c0\u614b\u4e2d\u8ffd\u6c42\u8ca1\u5bcc\u548c\u6210\u529f\u3002\n- \u6709\u610f\u8b58\u7684\u8ca1\u5bcc\u5275\u9020\u8005\uff0c\u6703\u89ba\u5bdf\u81ea\u5df1\u5728\u8ffd\u6c42\u80cc\u5f8c\u7684\u52d5\u6a5f\u3002\n- \u6709\u610f\u8b58\u7684\u8ca1\u5bcc\u5275\u9020\u8005\uff0c\u77ad\u89e3\u81ea\u5df1\u7684\u8ca1\u5bcc\u5275\u9020\u6703\u5c0d\u5468\u906d\u7684\u751f\u614b\u7cfb\u7d71\u7522\u751f\u4f55\u7a2e\u5f71\u97ff\u3002\n\n\ud83d\udd30\u5099\u8a3b\uff1a\n(1) \u51fa\u81ea\u65bcBreathing Room\u5b98\u7db2\u7684\u975c\u5fc3\u51a5\u60f3\u7df4\u7fd2\nwww.breathingroom.com/free-meditation-chinese\n(2)\u300a\u56db\u500b\u795e\u8056\u7684\u79d8\u5bc6\uff1a\u95dc\u65bc\u611b\u8207\u5bcc\u8db3\u300b",
