"description": "\u7b97\u547d\u7b97\u4e0a\u766e\uff1f\n\u7b97\u547d\u6210\u4fe1\u4ef0\uff1f\n\u7b97\u547d\u5373\u6539\u904b\uff1f\n\u547d\u5230\u5e95\u662f\u8d8a\u7b97\u8d8a\u660e\uff1f\n\u9084\u662f\u8d8a\u7b97\u8d8a\u5dee\uff1f\n\u5927\u5bb6\u591a\u591a\u5c11\u5c11\u4e0d\u8ad6\u4e3b\u52d5\u88ab\u52d5\uff0c\u90fd\u6709\u53bb\u627e\u7b97\u547d\u8001\u5e2b\u7684\u7d93\u9a57\u3002\n\u6709\u795e\u6e96\u7684\u7b97\u547d\u7d93\u9a57\uff0c\u4e5f\u6709\u4e0d\u6e96\u7684\u96e2\u8b5c\u7684\u7d93\u9a57\uff5e\n\u5230\u5e95\u600e\u6a23\u77e5\u9053\u9019\u4e9b\u8001\u5e2b\u662f\u4e0d\u662f\u5728\u778e\u63b0\u7684\u5462\uff1f\n\u770b\u7b97\u547d\u8001\u5e2b\u5c31\u8ddf\u770b\u91ab\u751f\u4e00\u6a23\uff0c\n\u4e0d\u662f\u6709\u540d\u7684\u8001\u5e2b\u5c31\u9069\u5408\u4f60\uff0c\n\u9084\u662f\u8981\u627e\u5230\u5408\u9069\u7684\uff0c\n\u4e5f\u4e0d\u8981\u5230\u8655\u554f\u5230\u8655\u807d\uff0c\n\u8ddf\u5403\u85e5\u4e00\u6a23\uff0c\u4e82\u670d\u4e00\u5806\u85e5\u5c0d\u8eab\u9ad4\u66f4\u4e0d\u597d\uff01\n\u6700\u5f8c\u8001\u5e2b\u89e3\u60d1\u4e00\u500b\u795e\u79d8\u7684\u554f\u984c\u3002\n\u771f\u6b63\u7684\u51fa\u751f\u6642\u9593\uff0c\u8ddf\u6236\u653f\u4e8b\u52d9\u6240\u767b\u8a18\u7684\u6642\u9593\u4e0d\u4e00\u6a23\u3002\n\u63ea\uff5e\uff5e\uff5e\u76e1\u8981\u770b\u54ea\u500b\u5462\uff1f\n\nInstagram:@ascended_928\nFacebook:\u795e\u4ed9\u88dc\u7fd2\u73ed\nYouTube: \u795e\u4ed9\u88dc\u7fd2\u73edYT\n\u5de5\u4f5c\u8acb\u6d3d\uff1ashensiantutoring@gmail.com",
