"description": "\u672c\u7bc0\u76ee\u7531\u300e\u9b06\u980cChansoul\u300f\u5408\u4f5c\u64ad\u51fa\n\n\u9b06\u980c\u7684\u6bcf\u9805\u7642\u7a0b\u88e1\u90fd\u5305\u542b\u4e86\u8108\u8f2a\u55c5\u9999&amp;\u980c\u7f3d\u6d17\u6ecc\u3002\n\u9032\u9580\u6642\u6703\u5148\u62bd\u5f35\u5f69\u8679\u5361\u5c0d\u61c9\u4f60\u6700\u8fd1\u6bd4\u8f03\u7f3a\u4e4f\u7684\u8108\u8f2a\u80fd\u91cf\uff0c\n\u63d0\u9192\u81ea\u5df1\u4e5f\u7d66\u81ea\u5df1\u4e00\u6bb5\u5c0f\u795d\u798f\uff0c\n\u518d\u6d17\u9aee\u524d\u6703\u9032\u884c\u975c\u5fc3\u7684\u980c\u7f3d\u5100\u5f0f\uff0c\n\n\u6b61\u8fce\u5927\u5bb6\u641c\u5c0b\u9b06\u980c\u5b98\u65b9Line ID:@chansoul(\u8981\u8a18\u5f97\u52a0@\u5537)\n\u9ede\u9032\u53bb\u6309\u6211\u8981\u9810\u7d04\u586b\u5beb\u57fa\u672c\u7684\u59d3\u540d\u96fb\u8a71\u5c31\u80fd\u5efa\u7acb\u8cc7\u6599\u958b\u59cb\u9810\u7d04\u4e86\uff0c\n(\u9ede\u9032\u53bb\u9810\u7d04\u6703\u986f\u793a\u9aee\u578b\u5e2b\u540d\u7a31\uff0c\u770b\u4f60\u6c92\u6709\u60f3\u8981\u4ecb\u7d39\u9aee\u578b\u5e2b\u6216\u8acb\u5927\u5bb6\u6c92\u6709\u7279\u5225\u60f3\u627e\u90a3\u4f4d\u9aee\u578b\u5e2b\u53ef\u52fe\u9078\u4e0d\u6307\u5b9a\u9aee\u578b\u5e2b)\n\n\u5373\u65e5\u8d77\u81f34/30\u4ee5\u524d\u7684\u9810\u7d04\u4eab\u6709\u526a\u9aee8\u6298\u512a\u60e0\u5537\uff01\n\u7dda\u4e0a\u9810\u7d04\u6642\u5e6b\u6211\u5011\u5728\u5099\u8a3b\u8655\u586b\u4e0a\uff1a\u795e\u4ed9\u88dc\u7fd2\u73edoooxxx\uff0c\n\u5c0f\u7de8\u5c31\u6703\u6536\u5230\u9810\u7d04\u7684\u8cc7\u8a0a\n\u597d\u597d\u53bb\u8b93\u81ea\u5df1\u7684\u8eab\u5fc3\u9748\u6d17\u6ecc\u3002\n\n\u50b3\u9001\u9580\uff1ahttps://chansoul.com.tw/\n\n\u8a18\u5f97\u52a0LINE\u9810\u7d04\u563f\uff01\n\n\u672c\u96c6\u5167\u5bb9\uff1a\n\u9322\u6c38\u9060\u4e0d\u5acc\u591a\uff0c\u8cfa\u9322\u662f\u5927\u90e8\u5206\u4eba\u7684\u8ab2\u984c\u3002\n\u592a\u591a\u4eba\u79c1\u8a0a\u6211\u5011\u60f3\u8981\u65b0\u7684\u62db\u8ca1\u5c0f\u6487\u6b65\u3002\n\u4e39\u4e39\u8001\u5e2b\u4eca\u5929\u5c31\u4f86\u6559\u5927\u5bb6\uff0c\u8ca1\u795e\u600e\u9ebc\u62dc\uff1f\u62dc\u62dc\u7684\u6642\u9593\u5730\u9ede\u7269\u54c1\u8aaa\u7684\u8a71\u5168\u90fd\u6709\u8b1b\u7a76\uff01\n\u9304\u97f3\u9014\u4e2d\u9084\u628a\u8ca1\u795e\u7d66\u8acb\u4e0b\u4f86\u554f\u9ede\u4e8b\u3002\n\u6c92\u770b\u904e\u9019\u7a2e\u64cd\u4f5c\uff0c\u6709\u8ca1\u795eline\u5c31\u662f\u4e0d\u4e00\u6a23\u3002\n\u6700\u5f8c\u628a\u7d19\u7b46\u62ff\u51fa\u4f86\uff0c\u628a\u63e1\u597d\u6642\u9593\u88dc\u8ca1\u5eab\u62db\u8ca1\u904b\uff01\n\u5225\u653e\u904e\u8cfa\u9322\u7684\u597d\u6a5f\u6703\uff01\n\nInstagram:@ascended_928\nFacebook:\u795e\u4ed9\u88dc\u7fd2\u73ed\nYouTube: \u795e\u4ed9\u88dc\u7fd2\u73edYT\n\u5de5\u4f5c\u8acb\u6d3d\uff1ashensiantutoring@gmail.com",
